import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./routes/Home";

function Movie() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/movie"></Route>
      </Switch>
    </Router>
  );
}

export default Movie;
